class Navbar extends HTMLElement {
  constructor() {
    super();
    this.attachShadow({ mode: 'open' })
    this.shadowRoot.appendChild(navbar.content.cloneNode(true))

    this.navbar = this.shadowRoot.getElementById('site-navigation-navbar')
    this.toggle = this.shadowRoot.getElementById('site-navigation-navbar-toggle')
    this.links = this.shadowRoot.querySelectorAll('#site-navigation-navbar-nav-links a')
    this.sections = this.getSections()
    this.last = 0
  }

  // noinspection JSUnusedGlobalSymbols
  connectedCallback () {
    const styles = document.querySelector('link[href*="main.min.css"]')
    if (styles) this.shadowRoot.appendChild(styles.cloneNode())

    window.addEventListener('scroll', () => { this.onScroll() })

    // Limits functionality to home page
    if (document.getElementById('hero')) window.addEventListener('scroll', () => { this.activeOnScroll() })

    window.addEventListener('scroll', () => { this.closeMenuOnScroll() })
    window.addEventListener('resize', () => { this.closeMenuOnResize() })
  }

  onScroll() {
    window.scrollY > 0
      ? this.navbar.classList.add('shadow-lg')
      : this.navbar.classList.remove('shadow-lg')
  }

  closeMenuOnScroll () {
    const top = window.scrollY

    this.toggle.checked === true && top < this.last
      ? this.toggle.checked = true
      : this.toggle.checked = false

    this.last = top
  }

  closeMenuOnResize () {
    if (this.toggle.checked === true && window.innerWidth >= 768) this.toggle.checked = false
  }

  getSections () {
    const tmp = document.querySelectorAll('section')
    const arr = []

    tmp.forEach(item => {
      arr.push(item)
    })

    return arr //.slice(1)
  }

  activeOnScroll () {
    let current = ''
    const OFFSET = 80

    this.sections.forEach((section) => {
      const sectionTop = section.offsetTop
      if (scrollY >= (sectionTop - OFFSET)) current = section.getAttribute('id')
    })

    this.links.forEach((li) => {
      li.classList.remove('active')
      if (li.classList.contains(current)) li.classList.add('active')
    })
  }
}

customElements.define('navbar-component', Navbar)
